member.summary:
Снять активные:
"Y" - снять активные безадресные заявки фирмы с тем же кодом бумаги, направлением и кодом расчетов, как и у регистрируемой заявки;
"N" - не снимать активные заявки.

Снять активные:
"Y" - снять активные безадресные заявки фирмы с тем же кодом бумаги, направлением и кодом расчетов, как и у регистрируемой заявки;
"N" - не снимать активные заявки.

Описывает состояние соединения с ТС ММВБ.
Возможное значение:
0 - не соединен;
1 - соединен с «боевой» ТС ММВБ;
2 - соединен с тестовой ТС ММВБ.

Тип торговой системы, возможные значения:
“P” - фондовый рынок или рынок ГЦБ;
“C” - валютный рынок;
“F” – срочный рынок.
